import React from 'react'

import './style.css';
import Tab from '../morecules/Tab';
import CategoryList from '../Types/Interface/Category-List.Interface';



interface Props{
  categoryListItem?: CategoryList[]
  selected: number
  onClickCategory(event: React.MouseEvent<HTMLButtonElement>): void
}



const Header: React.FC<Props> = ({ categoryListItem, onClickCategory, selected }) => {
  if (!categoryListItem) {
    return (
      <div></div>
    )
  }
  return (
   <>sdfsdfsd
   <div className='HeaderWrapper'>
        <div className='HeaderTitle'>개발자's Kiosk</div>
   </div>
   <div className='TabWrapper'>
   {categoryListItem.length ? (
          categoryListItem.map(({categoryId, categoryName }) => (
      <Tab 
      key={categoryId}
      id={categoryId}
      category={categoryName}
      active={selected === categoryId}
      onClickCategory={onClickCategory}
      />
      ))
      ) : (
        <h1>데이터가 없습니다.</h1>
      )}
   </div>
   </>
  )
}
export default Header
